import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (props) =>{
  return(
    <div>
      <p>Hello {props.name}</p>
    </div>
  )
}

const App = () => (
  <div>
    <p>Hello world</p>
    <Hello name="Kshitij" />
    <Hello name="Shambhavi" />
  </div>
)

ReactDOM.render(<App />, document.getElementById('root'))
